import React from 'react';
import logo from "../Images/2936956.png";
import './MainStyles.css';
import {TextField,Button} from "@mui/material";



const Login = () => {
  return (
    <div className="login-container"> 
     <div className="live-chat">
     <img src={logo} alt="logo" className="image-container"/>
     

     </div>
     <div className="login-box">

      <h2>Login Credentials</h2>
     <TextField id="standard-basic" label="Enter User Name" variant="standard" color="primary" name="name"/>
     <TextField id="outlined-password-input" label="Password" type="password" autoComplete="current-password" color="secondary" name="password" />

     <Button variant="outlined">Login</Button>


     </div>
      
    </div>
  )
}

export default Login;
